pub enum ErrorKind {
    Failed,
    Length {
        tag: Tag,
    },
    Noncanonical,
    Oid,
    Overflow,
    Overlength,
    TrailingData {
        decoded: Length,
        remaining: Length,
    },
    Truncated,
    Underlength {
        expected: Length,
        actual: Length,
    },
    UnexpectedTag {
        expected: Option<Tag>,
        actual: Tag,
    },
    UnknownTag {
        byte: u8,
    },
    Value {
        tag: Tag,
    },
}
